import { configureStore } from '@reduxjs/toolkit';

import carReducer from './carSlice'
import userReducer from './userSlice'

export default configureStore({
  reducer: {
    car: carReducer,
    user: userReducer
    // Adicione outros reducers aqui, se houver
  },
});
